import React, { useState } from 'react';
import './PlaneButton.css';

const PlaneButton = ({ onClick }) => {
  const [isClicked, setIsClicked] = useState(false);

  const handleClick = () => {
    setIsClicked(true);
    onClick();
  };

  return (
    <button
      className={`plane-button ${isClicked ? 'clicked' : ''}`}
      onClick={handleClick}
    >
      <svg
        className="plane-icon"
        xmlns="http://www.w3.org/2000/svg"
        viewBox="0 0 24 24"
      >
        <path
          fill={isClicked ? 'black' : 'white'}
          d="M20.18 10.58l-1.4-4.55C18.42 5 17.76 4 16.89 4H7.1c-.87 0-1.53 1-.89 1.55l1.4 4.55L2.8 13.4c-1.03.68-.47 2.6.85 2.6h4.72l1.28 4.21c.24.78 1.22.78 1.46 0L16.63 16h4.72c1.32 0 1.88-1.92.85-2.6l-3.49-2.82z"
        />
      </svg>
    </button>
  );
};

export default PlaneButton;
